import React from 'react';
import errorimg from '../Images/not_found.PNG';

const Error=(props)=>{
    return(
        <>
        <h1>404... Page not found</h1>
        <img src={props.errorimg} alt="errorimh" className="errorimg"/>
        </>
    )
}
export default Error;
